import {Link} from "react-router-dom";
import s from "../styles/ShoesCard.module.css";

const ShoesCard = ({shoe}) => {
    console.log(shoe)
    return (
        <li key={shoe.id} className={s.ShoesCard}>
            <Link to="">
                <img src={`http://localhost:3000/utils/img/${shoe.url_path}`} alt="1"></img>
                {require(`${this.props.cover}`)}
            </Link>
            <div>{shoe.brand}</div>
            <div>{shoe.model}</div>
            <div>{`USD ${shoe.price}`}</div>
            <div>{shoe.rating === 0 ? "Not yet rated" : shoe.rating}</div>
        </li>
    )
}


export default ShoesCard;
